import React, { useState } from 'react';
import {
    SafeAreaView,
    StyleSheet,
    ScrollView,
    View,
    Text,
    StatusBar,
    FlatList,
    TouchableOpacity,
    Image
} from 'react-native';
import { ItemProduct } from './ItemProduct'
export const ListProducts = ({ Carrito, setCarrito }) => {



    const DATA = [
        { id: 1, name: "producto 1", price: 700, image: "https://i.pinimg.com/474x/1a/86/c8/1a86c8c2a2dc5ba0a06a633cf6aa07df.jpg", count: 0 },
        { id: 2, name: "producto 2", price: 300, image: "data:image/jpeg;base64,", count: 0 },
        { id: 3, name: "producto 3", price: 400, image: "data:image/jpeg;base64,", count: 0 },
        { id: 4, name: "producto 4", price: 500, image: "data:image/jpeg;base64,", count: 0 },
        { id: 5, name: "producto 5", price: 350, image: "https://www.elcampesino.co/wp-content/uploads/2017/06/chontaduro.jpg", count: 0 },
        { id: 6, name: "producto 6", price: 800, image: "data:image/jpeg;base64,", count: 0 },
    ];



    return (
        <View style={{ flex: 1 }}>
            <FlatList
                data={DATA}
                keyExtractor={(item, index) => {
                    return index.toString();
                }}
                renderItem={({ item, index }) => {

                    return (
                        <ItemProduct item={item} Carrito={Carrito} setCarrito={setCarrito} />
                    )
                }

                }
            />
        </View>
    )
}
